<?php

namespace Database\Seeders;

use App\Models\User;
use App\Models\Genre;
use App\Models\Song;
use App\Models\Author;
// use Illuminate\Database\Console\Seeds\WithoutModelEvents;
use Illuminate\Database\Seeder;

class DatabaseSeeder extends Seeder
{
    public function run()
    {
        $authorsData = [
            [
                'name' => 'Depeche Mode',
                'url'=>'data:image/jpeg;base64,',
            ],
            [
                'name' => 'The Rolling Stones',
                'url' => 'data:image/png;base64,',
            ],
            [
                'name' => 'U2',
                'url' => 'data:image/jpeg;base64,',
            ],
        ];
        $authors = collect($authorsData)->map(function ($data) {
            return Author::factory()->create([
                'nickname' => $data['name'],
                'url' => $data['url'],
            ]);
        });

        $genresData = ['ROCK', 'POP', 'ELECTRO', 'RAP', 'NTP'];
        $genres = collect($genresData)->map(function ($type) {
            return Genre::factory()->create(['type' => $type]);
        });

        $songsData = [
            [
                'title' => 'Song One',
                'url' => 'https://song1.com'
            ],
            [
                'title' => 'Song Two',
                'url' => 'https://song2.com'
            ],
            [
                'title' => 'Song Three',
                'url' => 'https://song3.com'
            ],
            [
                'title' => 'Song Four',
                'url' => 'https://song4.com'
            ],
            [
                'title' => 'Song Five',
                'url' => 'https://song5.com'
            ],
            [
                'title' => 'Song Six',
                'url' => 'https://song6.com'
            ],
            [
                'title' => 'Song Seven',
                'url' => 'https://song7.com'
            ],
            [
                'title' => 'Song Eight',
                'url' => 'https://song8.com'
            ],
            [
                'title' => 'Song Nine',
                'url' => 'https://song9.com'
            ],
            [
                'title' => 'Song Ten',
                'url' => 'https://song10.com'
            ],
        ];
        collect($songsData)->each(function ($data) use ($authors, $genres) {
            Song::factory()->create([
                'title' => $data['title'],
                'url' => $data['url'],
                'author_id' => $authors->random()->id,
                'genre_id' => $genres->random()->id,
            ]);
        });
    }
}